#include "common.h"
using namespace std;

namespace findAllConcatenatedWordsInADict {
    class Solution {
    public:
        vector<string> findAllConcatenatedWordsInADict(vector<string>& words) {
            int n = words.size();
            if (n <= 1) {
                return vector<string>();
            }
            
            set<string> res;
            set<string> singles;
            sort(words.begin(), words.end(), [](const string& a, const string& b){
                if (a.length() != b.length()) { return a.length() < b.length(); }
                else { return a < b; };
            });
            singles.insert(words[0]);
            for (int i = 1; i < n; ++i) {
                if (isConcatenated2(words[i], singles, res)) {
                    res.insert(words[i]);
                } else {
                    if (words[i].length()) {
                        singles.insert(words[i]);
                    }
                }
            }
            
            return vector<string>(res.begin(), res.end());
        }
    private:
        bool isConcatenated(const string& a, const set<string>& singles, const set<string>& concate) {
            if (concate.find(a) != concate.end()) {
                return true;
            }
            int alen = a.length();
            // use lower bound to locate possible candidate.
            auto it = upper_bound(singles.begin(), singles.end(), a);
            while (it != singles.begin()) {
                --it;
                const string& s = *it;
                if (s[0] != a[0]) {
                    break;
                }
                
                int len = s.length();
                if (len > alen || a.substr(0, len) != s) {
                    continue;
                }
                if (a == s || isConcatenated(a.substr(len), singles, concate)) {
                    return true;
                }
            }
           
            return false;
        }
        bool isConcatenated2(const string& a, const set<string>& singles, const set<string>& concate) {
            int n = a.length();
            vector<bool> res(n + 1, false);
            res[0] = true;
            for (int i = 1; i <= n; ++i) {
                for (int j = 0; j < i; ++j) {
                    if (res[j] && singles.find(a.substr(j, i - j)) != singles.end()) {
                        res[i] = true;
                        break;
                    }
                }
            }
            return res[n];
        }
    };
}
